import React from "react";
import {v4 as uuid } from "uuid";
import Dog from "./Dog";

const DogList = ({dogs}) => {
    return (
        <div className="DogList">
            {dogs.map(d=> (
                <Dog 
                key={uuid()} 
                name={d.name}
                age={d.age}
                src={d.src}
                facts={d.facts}
                />
            ))}
        </div>
    )
};

export default DogList;
